    [],nt"revision_timestamp": "2016-05-20T00:44:29.180009",nt"name": "raw-neutron-scattering-data-for-strain-measurement-of-hydraulically-loaded-granite-and-mar",nt"isopen":
    true,nt"url": null,nt"notes": "This entry contains raw data files from
    experiments performed on the Vulcan beamline at the Spallation Neutron Source at
    Oak Ridge National Laboratory using a pressure cell. Cylindrical granite and marble
    samples were subjected to confining pressures of either 0 psi or approximately 2500
    psi and internal pressures of either 0 psi, 1500 psi or 2500 psi through a blind
    axial hole at the center of one end of the sample. The sample diameters were 1.5"
    and the sample lengths were 6". The blind hole was 0.25" in diameter and 3" deep.
    One set of experiments measured strains at points located circumferentially around
    the center of the sample with identical radii to determine if there was strain variability
    (this would not be expected for a homogeneous material based on the symmetry of
    loading). Another set of experiments measured load variation across the radius of
    the sample at a fixed axial and circumferential location. Raw neutron diffraction
    intensity files and experimental parameter descriptions are included.",nt"license_title":
